// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./SyndicateOwnerLogic.sol";

/// @author Syndicate Inc.
/// @notice Core module for syndicate data
contract SyndicateClosedEndFundStoreV0 is SyndicateOwnerLogic {
    /// @notice Used to initialize the SyndicateClosedEndFundStoreV0 contract.
    constructor() SyndicateOwnerLogic() {}

    /// Tracks the logic contracts that have write-access to this data contract.
    /// These addresses should be able to access the setter functions.
    mapping(address => bool) public logicContractAllowed;

    /// @notice emit an event when a new logic contract is added by the owner.
    event logicContractAdded(address logicContractAddress, uint256 timestamp);

    /// @notice emit an event when a new logic contract is removed by the owner.
    event logicContractRemoved(address logicContractAddress, uint256 timestamp);

    /// Modifiers---------------------------------------------------------------

    /// @notice Only proceed if msg.sender is a logic contract that is allowed
    /// to call this data contract.
    modifier onlyLogicContractAllowed() {
        _isLogicContractAllowed();
        _;
    }

    function _isLogicContractAllowed() internal view {
        require(logicContractAllowed[msg.sender], "INVALID_LOGIC_CONTRACT");
    }

    /// Owner functions---------------------------------------------------------

    /// @notice Used by contract owner to grant write access to a logic
    /// contract.
    function addLogicContractAllowed(address logicContractAddress)
        public
        onlyOwner
    {
        logicContractAllowed[logicContractAddress] = true;

        emit logicContractAdded(logicContractAddress, block.timestamp);
    }

    /// @notice Used by contract owner to remove write access to a logic
    /// contract.
    function removeLogicContractAllowed(address logicContractAddress)
        public
        onlyOwner
    {
        logicContractAllowed[logicContractAddress] = false;

        emit logicContractRemoved(logicContractAddress, block.timestamp);
    }

    // Contract data------------------------------------------------------------

    // Maps address => true if the wallet at that address is currently managing
    // a Syndicate. Manager wallets are required to be unique to prevent
    // commingling of assets between Syndicates and to ensure that transparency
    // is provided to the members.
    mapping(address => bool) public isManager;

    // The managerCurrent is the address to which deposited funds are sent.
    mapping(address => address) public managerCurrent;
    // Used to transfer ownership of a Syndicate. A new current manager
    // needs to claim the Syndicate after being nominated pending manager.
    mapping(address => address) public managerPending;
    // The manager fee address must be different from the manager's address
    // in order to avoid commingling the Syndicate's assets with its
    // manager's profits.
    mapping(address => address) public managerFeeAddress;
    // Management fees are currently assessed manually by calling
    // `managerAssessManagementFee()`. In the future, this will
    // automatically be assessed yearly when we have asset management built
    // into the smart contract.
    // A standard structure would be a 2% management fee (200 basis points)
    // and a 20% performance fee (2000 basis points). For more info, see:
    // https://www.investopedia.com/terms/t/two_and_twenty.asp
    mapping(address => uint256) public managerManagementFeeBasisPoints;
    // The performance fee is deducted from the distributions withdrawn
    // from a fund after close, and sent to the managerFeeAddress.
    mapping(address => uint256) public managerPerformanceFeeBasisPoints;
    // The profit share to Syndicate Protocol is deducted from the
    // distributions withdrawn from a fund after close (like the
    // performance fee). The minimum profit share is 0.50%, or 50 basis
    // points.
    mapping(address => uint256) public syndicateProfitShareBasisPoints;
    // The maximum number of members that can make deposits
    mapping(address => uint256) public numMembersMax;
    // Tracks the number of members with nonzero deposits. For accurate
    // calculation of each member's profit share, this value should NEVER
    // be modified after the Syndicate is closed.
    mapping(address => uint256) public numMembersCurrent;
    // Address of the ERC20 contract used for tracking deposits. A
    // stablecoin is recommended since this is used to calculate ownership,
    // and fluctations in value can affect these ownership calculations.
    mapping(address => address) public depositERC20Address;
    // The minimum amount that a single address can deposit. This is useful
    // when you want to restrict the lowest amount that each wallet can
    // deposit.
    mapping(address => uint256) public depositMinMember;
    // The maximum amount that a single address can deposit. This is useful
    // when you want to restrict the amount that each wallet can deposit
    // into the fund to ensure that ownership is distributed among many
    // people. In the future, we can consider having a mapping that allows
    // you to set per-user deposit thresholds but this is better saved for
    // the asset management contract.
    mapping(address => uint256) public depositMaxMember;
    // The maximum amount that a fund can raise, e.g. an investment target.
    mapping(address => uint256) public depositMaxTotal;
    // Tracks total deposits of all members. For accurate calculation of
    // each member's ownership stake, this value should NEVER be modified
    // after the Syndicate is closed.
    mapping(address => uint256) public depositTotal;
    // Track the creation date in UNIX time. This is also available in the
    // events but the events are tougher to access on chain. This creation
    // date should be relied upon as the source of truth, not the timestamp
    // for the `managerCreatedSyndicate` event.
    mapping(address => uint256) public dateCreation;
    // Reflects either the date at which a Syndicate is scheduled to close,
    // or, if the syndicate was closed early (e.g. manually by a manager, or
    // automatically because the investment goal was reached), the actual
    // date of close. This date can be used for calculating management fees.
    mapping(address => uint256) public dateClose;
    // True if the Syndicate's deposits have not been finalized by the
    // manager.
    mapping(address => bool) public open;
    // True if the Syndicate has enabled withdrawals of distributions.
    mapping(address => bool) public distributing;
    // True if the Syndicate ONLY accepts deposits from allowed
    // addresses. False if any (accredited) member can deposit.
    mapping(address => bool) public allowlistEnabled;
    // True if the manager can adjust deposit and distribution amounts
    // after initalization. Can only be set on Syndicate creation and
    // cannot be changed after that point.
    mapping(address => bool) public modifiable;
    // True if a member can transfer a portion of their deposit to another
    // address. All transfers must occur before distributions are set such
    // that we only update values in deposit mapping structs. A manager's
    // ability to initiate a transfer is determined by `modifiable` and is
    // independent to `transferable`. Member-initiated transfers may have
    // regulatory concerns (e.g. by allowing a transfer to a non-accredited
    // investor), while manager-initiated transfers are safe for internal
    // bookkeeping purposes.
    mapping(address => bool) public transferable;

    // Maps memberAddress => depositAmount, tracking the amount that a
    // member has contributed to a Syndicate. For accurate calculation of
    // the member's profit share, this value should NEVER be modified after
    // the Syndicate is closed.
    mapping(address => mapping(address => uint256)) public depositMember;
    // Maps distributionERC20Address => true if the manager has set a
    // distribution for the specified token, false otherwise
    mapping(address => mapping(address => bool))
        public distributionERC20Addresses;
    // Maps distributionERC20Address => the amount of tokens the manager
    // has set for distribution
    mapping(address => mapping(address => uint256)) public distributionTotal;
    // Maps distributionERC20Address => mapping(memberAddress =>
    // the distribution in that token claimed by that member)
    mapping(address => mapping(address => mapping(address => uint256)))
        public distributionClaimedMember;
    // Maps distributionERC20Address => the total distributions in that
    // token claimed by ALL members
    mapping(address => mapping(address => uint256))
        public distributionClaimedTotal;
    // Maps memberAddress => true if members are allowed to deposit to a
    // Syndicate, false otherwise. Initialized to false at all addresses.
    // ONLY applied when SyndicateValues.allowlistEnabled is true. Due to
    // the trivial ease of creating new addresses, it is ineffective to
    // maintain a list of blocked addresses (blocklist), so we implement an
    // allowlist instead.
    mapping(address => mapping(address => bool)) public addressAllowed;
    // Generic mapping for storing arbitrary data. Maps key => value
    mapping(address => mapping(string => string)) public metadata;

    /// Setters-----------------------------------------------------------------

    function setIsManager(address manager, bool _isManager)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        isManager[manager] = _isManager;
    }

    function setManagerCurrent(address syndicateAddress, address currentManager)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        managerCurrent[syndicateAddress] = currentManager;
    }

    function setManagerPending(address syndicateAddress, address pendingManager)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        managerPending[syndicateAddress] = pendingManager;
    }

    function setManagerFeeAddress(address syndicateAddress, address feeAddress)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        managerFeeAddress[syndicateAddress] = feeAddress;
    }

    function setManagerManagementFeeBasisPoints(
        address syndicateAddress,
        uint256 feeBasisPoints
    ) public onlyLogicContractAllowed whenNotPaused {
        managerManagementFeeBasisPoints[syndicateAddress] = feeBasisPoints;
    }

    function setManagerPerformanceFeeBasisPoints(
        address syndicateAddress,
        uint256 feeBasisPoints
    ) public onlyLogicContractAllowed whenNotPaused {
        managerPerformanceFeeBasisPoints[syndicateAddress] = feeBasisPoints;
    }

    function setSyndicateProfitShareBasisPoints(
        address syndicateAddress,
        uint256 profitShareBasisPoints
    ) public onlyLogicContractAllowed whenNotPaused {
        syndicateProfitShareBasisPoints[
            syndicateAddress
        ] = profitShareBasisPoints;
    }

    function setNumMembersMax(address syndicateAddress, uint256 maxMembers)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        numMembersMax[syndicateAddress] = maxMembers;
    }

    function setNumMembersCurrent(
        address syndicateAddress,
        uint256 currentMembers
    ) public onlyLogicContractAllowed whenNotPaused {
        numMembersCurrent[syndicateAddress] = currentMembers;
    }

    function setDepositERC20Address(
        address syndicateAddress,
        address depositAddress
    ) public onlyLogicContractAllowed whenNotPaused {
        depositERC20Address[syndicateAddress] = depositAddress;
    }

    function setDepositMinMember(address syndicateAddress, uint256 minDeposit)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        depositMinMember[syndicateAddress] = minDeposit;
    }

    function setDepositMaxMember(address syndicateAddress, uint256 maxDeposit)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        depositMaxMember[syndicateAddress] = maxDeposit;
    }

    function setDepositMaxTotal(
        address syndicateAddress,
        uint256 maxDepositTotal
    ) public onlyLogicContractAllowed whenNotPaused {
        depositMaxTotal[syndicateAddress] = maxDepositTotal;
    }

    function setDepositTotal(address syndicateAddress, uint256 total)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        depositTotal[syndicateAddress] = total;
    }

    function setDateCreation(address syndicateAddress, uint256 date)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        dateCreation[syndicateAddress] = date;
    }

    function setDateClose(address syndicateAddress, uint256 date)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        dateClose[syndicateAddress] = date;
    }

    function setOpen(address syndicateAddress, bool isOpen)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        open[syndicateAddress] = isOpen;
    }

    function setDistributing(address syndicateAddress, bool isDistributing)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        distributing[syndicateAddress] = isDistributing;
    }

    function setAllowlistEnabled(address syndicateAddress, bool isEnabled)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        allowlistEnabled[syndicateAddress] = isEnabled;
    }

    function setModifiable(address syndicateAddress, bool isModifiable)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        modifiable[syndicateAddress] = isModifiable;
    }

    function setTransferable(address syndicateAddress, bool isTransferable)
        public
        onlyLogicContractAllowed
        whenNotPaused
    {
        transferable[syndicateAddress] = isTransferable;
    }

    function setDepositMember(
        address syndicateAddress,
        address memberAddress,
        uint256 deposit
    ) public onlyLogicContractAllowed whenNotPaused {
        depositMember[syndicateAddress][memberAddress] = deposit;
    }

    function setDistributionERC20Addresses(
        address syndicateAddress,
        address distributionERC20Address,
        bool isSet
    ) public onlyLogicContractAllowed whenNotPaused {
        distributionERC20Addresses[syndicateAddress][
            distributionERC20Address
        ] = isSet;
    }

    function setDistributionTotal(
        address syndicateAddress,
        address distributionERC20Address,
        uint256 total
    ) public onlyLogicContractAllowed whenNotPaused {
        distributionTotal[syndicateAddress][distributionERC20Address] = total;
    }

    function setDistributionClaimedMember(
        address syndicateAddress,
        address distributionERC20Address,
        address memberAddress,
        uint256 amount
    ) public onlyLogicContractAllowed whenNotPaused {
        distributionClaimedMember[syndicateAddress][distributionERC20Address][
            memberAddress
        ] = amount;
    }

    function setDistributionClaimedTotal(
        address syndicateAddress,
        address distributionERC20Address,
        uint256 total
    ) public onlyLogicContractAllowed whenNotPaused {
        distributionClaimedTotal[syndicateAddress][
            distributionERC20Address
        ] = total;
    }

    function setAddressAllowed(
        address syndicateAddress,
        address memberAddress,
        bool allowed
    ) public onlyLogicContractAllowed whenNotPaused {
        addressAllowed[syndicateAddress][memberAddress] = allowed;
    }

    function setMetadata(
        address syndicateAddress,
        string calldata metadataKey,
        string calldata metadataValue
    ) public onlyLogicContractAllowed whenNotPaused {
        metadata[syndicateAddress][metadataKey] = metadataValue;
    }
}
